import React, {Component} from 'react';
import {Tabs, Tab, Grid, Cell, Card, CardTitle, CardText, CardActions, Button, CardMenu, IconButton} from 'react-mdl';

class Projects extends Component {
	constructor(props) {
		super(props);
		this.state = {activeTab: 0};
	}
	togglecategories() {
			if(this.state.activeTab===0){
				return(
					<div className='projects-grid'>
						<Card shadow={5} style={{minWidth: '450', margin:'auto'}}>
						  <CardTitle style={{color:'grey', height:'176px', width:'100%', background: 'url(https://github.com/wsun26/ece448/blob/master/MP4/pong.gif?raw=true) no-repeat center / contain'}}>React Project #1</CardTitle>
							<CardText>blah blah</CardText>
							<CardActions border>
								<Button colored href='https://github.com/wsun26/ece448/tree/master/MP4'>Github</Button>
								<Button colored>CodePen</Button>
								<Button colored>LiveDemo</Button>
							</CardActions>
							<CardMenu style={{color: '#fff'}}>
								<IconButton name='share'></IconButton>
							</CardMenu>
						</Card>
						<Card shadow={5} style={{minWidth: '450', margin:'auto'}}>
						  <CardTitle style={{color:'#fff', height: '176px', background: 'url(https://doc.ebichu.cc/react/img/logo.svg) center / cover'}}>React Project #2</CardTitle>
							<CardText>blah blah</CardText>
							<CardActions border>
								<Button colored>Github</Button>
								<Button colored>CodePen</Button>
								<Button colored>LiveDemo</Button>
							</CardActions>
							<CardMenu style={{color: '#fff'}}>
								<IconButton name='share'></IconButton>
							</CardMenu>
						</Card>
						<Card shadow={5} style={{minWidth: '450', margin:'auto'}}>
						  <CardTitle style={{color:'#fff', height: '176px', background: 'url(https://doc.ebichu.cc/react/img/logo.svg) center / cover'}}>React Project #3</CardTitle>
							<CardText>blah blah</CardText>
							<CardActions border>
								<Button colored>Github</Button>
								<Button colored>CodePen</Button>
								<Button colored>LiveDemo</Button>
							</CardActions>
							<CardMenu style={{color: '#fff'}}>
								<IconButton name='share'></IconButton>
							</CardMenu>
						</Card>
					</div>
				)
			} else if(this.state.activeTab === 1){
				return (
					<div><h1>This is Angular</h1></div>
				)
			} else if(this.state.activeTab === 2){
				return (
					<div><h1>This is VueJS</h1></div>
				)
			} else if(this.state.activeTab === 3){
				return (
					<div><h1>This is VueJS</h1></div>
				)
			}
	}

	render() {
		return(
			<div className='category-tabs'>
				<Tabs activeTab={this.state.activeTab} onChange={(tabId)=>this.setState({activeTab:tabId})} ripple>
					<Tab>Python</Tab>
					<Tab>JavaScript</Tab>
					<Tab>Senior Design</Tab>
					<Tab>Test</Tab>

				</Tabs>

				<Grid>
				  <Cell col={12}>
					  <div className='content'>{this.togglecategories()}</div>
					</Cell>
				</Grid>
			</div>
		)
	}
}

export default Projects;
